import { Component, Input } from "@angular/core"

@Component({
  selector: 'quiz-main',
  template: `
  <div class="root">
    <div class="main">
      <h1>{{ titulo }}</h1>
      <li class="tab-option" *ngFor="let tab of tabsData; let i = index">
        <tab-option (click)="switchTab(i)" [tabId]="tab.tabId" [selecionado]="i == selectedTabIndex"></tab-option>
      </li>
      <tab-content [conteudoTab]="tabsData[selectedTabIndex].tabContent" ></tab-content>
    </div>
  </div>
  `,
  styles: [`
    .root {
      width: 100%;
      text-align: center;
      margin-top: 200px;
      font-family: Arial, sans-serif;
      -webkit-font-smoothing: antialiased;
      -moz-osx-font-smoothing: grayscale;
      text-align: center;
      color: #2c3e50;
    }
    .main {
      text-align: center;
      background: rgb(255, 146, 102);
      display: inline-block;
      text-align: center;
      border-radius: 10px;
      padding: 5px;
      width: auto;
    }
    .tab-option {
      display: inline-block;
    }
  `]
})
export class QuizMainComponent {
  titulo = 'Tabs com Angular';

  @Input() tabsData !: any[]

  selectedTabIndex: number = 0;

  switchTab(index: number) {
    this.selectedTabIndex = index;
  }
}

